import React from 'react'

export const Skills = () => {
  return (
    <>
    <div id="Skills" className="container skills">
    <div><h1>SKILLS</h1></div>
    {Skills.map((data)=>{<>
      <div className="item" key={data.id}>
                <img src={`/assets/${data.imageSrc}`} alt="" />
                <h3>{data.title}</h3>
              </div>
    </>})}
    </div>
  </>
  );
}

export default Skills;
